	// [레이어] 마커 레이어 생성기
	// @param Array<Object> => {name:"", point:[lon:0, lat:0], img:""}
	// @return ol.layer.Vector
	function selectLayerVectorIcon(lonlat_list){
		var icon_features=[];
		
		// 파라미터 검사.
		if(!lonlat_list || 
			!lonlat_list.length 
		){
			console.log("selectLayerVectorIcon 의 파라미터를 확인해 주세요.");
			return;
		}
		
		lonlat_list.forEach(function(item){
			var icon_feature = new ol.Feature({
				geometry: new ol.geom.Point(ol.proj.transform(item.point, "EPSG:4326", "EPSG:3857")),
				name: item.name,
			});
			
			var icon_image = new ol.style.Icon(({
				anchor: [0.5, 0.5],
				anchorXUnits: "fraction",
		 		anchorYUnits: "fraction",
				opacity: 0.7,
				src: item.img,
				scale: 1,
			}));
			
			var icon_text = new ol.style.Text({
				font: "bold 15px Arial", 
				textAlign: "center",
				text:  item.name,
				fill: new ol.style.Fill({
					color: "#FFFFFF",
				}),
				stroke: new ol.style.Stroke({
					color: "#555555",
					width: 2.0,
				}),
				offsetX: 0,
				offsetY: 0.5,
			});
			
			icon_feature.setStyle(new ol.style.Style({
				image: icon_image,
				text: icon_text,
			}));
			
			icon_features.push(icon_feature);
		});
		
		var vector_source = new ol.source.Vector({
			features: icon_features,
		});
	
		var vector_layer = new ol.layer.Vector({
		  	source: vector_source,
		});
		
		return vector_layer;
	}
	
	// [레이어] 라인 레이어 생성기
	// @param Array<Object> => {name:"", list_point:[[lon:0, lat:0], ...]}
	// @return ol.layer.Vector
	function selectLayerVectorLine(lonlat_list, color, width){
		var line_features=[];
		
		// 파라미터 검사.
		if(!lonlat_list || 
			!lonlat_list.length ||
			!color ||
			!width
		){
			console.log("selectLayerVectorLine 의 파라미터를 확인해 주세요.");
			return;
		}
		
		lonlat_list.forEach(function(item){
			var list_point = [];
			
			item.list_point.forEach(function(point){
				list_point.push(ol.proj.fromLonLat(point));
			});
			
			var line_feature = new ol.Feature({
				geometry: new ol.geom.LineString(list_point),
				name: item.name,
			});
			
			var line_style = new ol.style.Style({
				stroke: new ol.style.Stroke({
					color: color,
					width: width,
				})
			})
			
			line_feature.setStyle(line_style);
			
			line_features.push(line_feature);
		});
		
		var vector_source = new ol.source.Vector({
			features: line_features,
		});
	
		var vector_layer = new ol.layer.Vector({
		  	source: vector_source,
		});
		
		return vector_layer;
	}
	
	// [레이어] 폴리곤 레이어 생성기
	// @param GeoJSON
	// @return ol.layer.Vector
	function selectLayerVectorPolygon(list_geojson, color, width){
		// 파라미터 검사.
		if(!list_geojson
		){
			console.log("selectLayerVectorPolygon 의 파라미터를 확인해 주세요.");
			return;
		}
		
		var features = (new ol.format.GeoJSON({featureProjection: "EPSG:3857"})).readFeatures(list_geojson);
		
		var source_polygon = new ol.source.Vector({
			features: features,
      	});
		
		var polygon_style_function = function(feature) {
			var feature_name = feature.getProperties().name;
			var img_src = "";
			
			switch(feature_name.length){
				case 2:
					img_src="/image/box_nm2.png";
					break;
				case 3:
					img_src="/image/box_nm3.png";
					break;
				default:
					img_src="/image/box_nm4.png";
			}
			
			var icon_image = new ol.style.Icon(({
				anchor: [0.5, 0.5],
				anchorXUnits: "fraction",
		 		anchorYUnits: "fraction",
				opacity: 0.7,
				src: img_src,
				scale: 1,
			}));
			
			var icon_text = new ol.style.Text({
				font: "bold 15px Arial", 
				textAlign: "center",
				text:  feature_name,
				fill: new ol.style.Fill({
					color: "#FFFFFF",
				}),
				stroke: new ol.style.Stroke({
					color: "#555555",
					width: 2.0,
				}),
				offsetX: 0,
				offsetY: 0.5,
			});
			
			var polygon_style = new ol.style.Style({
				stroke: new ol.style.Stroke({
					color: color,
					width: width,
				}),
				fill: new ol.style.Fill({
					color: color,
				}),
			});
			
			var text_style = new ol.style.Style({
				text: icon_text,
				image: icon_image,
				geometry: function(feature) {
					// feature 밖의 중간 사용시
					// var polygon_extent = feature.getGeometry().getExtent();
					// var feature_center = ol.extent.getCenter(polygon_extent);
					
					// feature 안의 중간 사용시
					var feature_center = feature.getGeometry().getInteriorPoint().getCoordinates();
					return new ol.geom.Point(feature_center);
				}
			});
			
			return [text_style, polygon_style];
		}
		
	
		var vector_layer = new ol.layer.Vector({
		  	source: source_polygon,
		  	style: polygon_style_function,
		});
		
		return vector_layer;
	}
	
	
	// [레이어] 타일 레이어 생성기
	// @return ol.layer.Tile
	function selectLayerWmsTile(){
		var st_yy = "2105";
		var st_mm = "01";
		var st_dd = "02";
		var st_hh = "16";
		var mm = "00";
		
		var layer_wms_tile  = new ol.layer.Tile({
			source: new ol.source.TileWMS({
			  url: "http://geornd.hecorea.co.kr/sims2/wms",
			  params: {
				  FORMAT: "image/png", 
				  VERSION: "1.1.1",
				  TILED: true,
				  STYLES: "",
				  LAYERS: "sims2:scedist_lv01",
				  TIME: st_yy + "-" + st_mm + "-" + st_dd + "T" + st_hh + ":" + mm + ":00.0Z",
				  TILESORIGIN: 191598.8281 + "," + 462169.5625
			  }
		   })
		});
		
		return layer_wms_tile;
	}
	
