	// [뷰] 뷰 생성. 
	// @param Array<int>
	// @param int
	// @return ol.View
	function selectMapView(center, zoom){
		return new ol.View({
			projection: ol.proj.get("EPSG:2097"),
			center: ol.proj.fromLonLat(center), 
		  	zoom: zoom,
		  	maxZoom :17,
		  	minZoom: 7
		});
	}
	
	
	// [오버레이] 맵 오버레이 생성
	// @return ol.Overlay
	function selectMapOverlay(html){
		return new ol.Overlay({
			element: $(html).css({
				"background-color": "white",
				"width": "200px",
				"height": "200px",
				"position": "absolute",
				"left": "-20px",
				"bottom": "10px",
			}).get(0),
		});
	}
	
	
	// [맵] 맵 생성. 
	// @return ol.Map
	function selectMap(id){
		// 파라미터 검사.
		if(!id ||
			!$("#"+id).length
		){
			console.log("updateEventClick 의 파라미터를 확인해 주세요.");
			return;
		}
		
		return new ol.Map({
			target: id,
			controls: ol.control.defaults({attribution: false, zoom: false}),
			logo: false,
		});
	}
	
	
	// [이벤트] 클릭시 이벤트 발생. 
	// @param ol.Map
	// @param Array<Object> => {layer: ol.layer.Vector, function: function(){}}
	function updateEventClick(target_map, list_layer_function){
		// 파라미터 검사.
		if(!target_map ||
			!list_layer_function ||
			!list_layer_function.length 
		){
			console.log("updateEventClick 의 파라미터를 확인해 주세요.");
			return;
		}
		
		target_map.on("click", function (evt) {
			var feature_function = target_map.forEachFeatureAtPixel(
				evt.pixel,
				function (feature, layer) {
					var return_object ={};
					
					list_layer_function.forEach(function(item){
						if(item.layer == layer){
							return_object.feature = feature;
							return_object.function = item.function;
						}
					});
					
					if(Object.keys(return_object).length){
						return return_object;
						
					}else{
						null;
					}
				}
			);
			
			if (feature_function) {
				feature_function.function(feature_function.feature, evt);
			}else{
				console.log(ol.proj.toLonLat(evt.coordinate));
			}
			
		});
	}
	
	// [이벤트] 마커에 마우스 호버 이벤트. 
	// @param ol.Map
	// @param Array<Object> => {layer: ol.layer.Vector, function: function(){}, null_function: function(){}}
	function updateEventPointermove(target_map, list_layer_function){
		// 파라미터 검사.
		if(!target_map ||
			!list_layer_function ||
			!list_layer_function.length 
		){
			console.log("updateEventPointermove 의 파라미터를 확인해 주세요.");
			return;
		}
		
		target_map.on("pointermove", function (evt) {
			var hit_layer = null;
			
			var feature_function = target_map.forEachFeatureAtPixel(
				evt.pixel,
				function (feature, layer) {
					var return_object ={};
					 
					list_layer_function.forEach(function(item){
						if(item.layer == layer){
							return_object.feature = feature;
							return_object.function = item.function;
							hit_layer = layer;
						}
					});
					
					return Object.keys(return_object).length? return_object: null;
				}
			);
			
			if (!evt.dragging && feature_function) {
				feature_function.function(feature_function.feature, evt);
				
			} 
			
			list_layer_function.forEach(function(item){
				if(hit_layer != item.layer){
					item.null_function(evt);
				}
			});
			
		});
	}
	
	// [이벤트] map화면 밖 호버시 오버레이안보이게 
	// @param ol.Map
	// @param ol.Overlay
	function updateEventMouseleave(target_map, list_target_overlay){
		// 파라미터 검사.
		if(!target_map ||
			!list_target_overlay ||
			!list_target_overlay.length
		){
			console.log("updateEventMouseleave 의 파라미터를 확인해 주세요.");
			return;
		}
		
		target_map.on("mouseleave", function(){
			$(this).css("cursor", "default");
			list_target_overlay.forEach(function(item){
				item.setPosition(undefined);
			});
		});
	}
	
	
