		var map_overlay_last_bridge = selectMapOverlay("<div id='map_overlay_last_bridge' >광화대교 오버레이</div>");
		var map_overlay_bridge = selectMapOverlay("<div id='map_overlay_bridge' >대교 오버레이</div>");
		var map_overlay_river = selectMapOverlay("<div id='map_overlay_river' >하천 오버레이</div>");
		
