	return_factory.functions_and_objects.selectListLineBridge = selectListLineBridge;
	
	return_factory.functions_and_objects.selectLayerVectorIcon = selectLayerVectorIcon;
	return_factory.functions_and_objects.selectLayerVectorLine = selectLayerVectorLine;
	return_factory.functions_and_objects.selectLayerVectorPolygon = selectLayerVectorPolygon;
	return_factory.functions_and_objects.selectLayerWmsTile = selectLayerWmsTile;
